import React, { useEffect , useState } from 'react'
import './styles.css';
import { useSelector , useDispatch } from 'react-redux';
import { checkTempMin, checkTempMax, inputUsed } from '../Redux/actions'
import TempsCheck from '../Components/TempsCheck'
import { useNavigation} from '@react-navigation/native';

function TempsCalled() {

const navigation = useNavigation();
const hasInput = useSelector(state => state.inputUsed)
const dispatch = useDispatch();

 useEffect(() => {
    dispatch(checkTempMin());
    dispatch(checkTempMax());
 },[dispatch]);

 console.log(inputUsed)

 return(
   <div>
   <h1> <button className='botao' title="Next Screen" onClick={() => navigation.navigate('Home')}> Home </button></h1>
 {
   hasInput ?
    <TempsCheck />
   
   : (<div> Necessário input para exibição</div>)
  }
  </div> 
  )
    
}

export default TempsCalled;
